Major improvements:

1) Enable knowledge in float32/float64 data type transferred in float16, to reduce these knowledge data by half;
2) Use multiple threads for post processing knowledge data, and add more knowledge queues for one teacher-student online connection at the same time;
3) For some knowledge schema appearing in feed, get them in CPUPlace directly instead of fetch from GPUPlace.

